let mut host_futures = FuturesUnordered::new();
for host in hosts { let (sender, body) = hyper::body::Body::channel(); host_senders.push(sender); host_futures.push(create_future_to_send_request(body));
} Next, he wants to iterate through each of the shards. For each shard, he will send each chunk to each of the hosts: let mut shards = /* generate a stream of Shards */;
