} The last line is giving him a bit of trouble. Each of the requests to send the futures could fail, and he would like to propagate that failure. He's used to writing ? to propagate an error, but when he puts ? in sender.send_data he gets an error: error[E0277]: the `?` operator can only be applied to values that implement `Try` --> src/lib.rs:18:40 |
