while let Some(chunks) = shards.next().await { let chunk_futures = chunks .into_iter() .zip(&mut host_senders) .map(|(chunk, sender)| sender.send_data(chunk)); futures::join_all(chunk_futures).await?;
} But now he sees: error[E0277]: the `?` operator can only be applied to values that implement `Try` --> src/lib.rs:20:9 |
