Getting started with async Rust is easy. Most anywhere that you write fn in Rust, you can now write async fn (exception: extern blocks), starting with the main function: #[tokio::main] // or async_std::main, glommio::main, etc
async fn main() { println!("Hello, world!"); // <-- expect a warning here
} You can see that we decorated main with a #[tokio::main] attribute. This is how we select the runtime we will use: most runtimes emit a similar decorator, so you could change this to #[async_std::main], #[glommio::main], or #[embassy::main] and all the examples and code we talk about in this document would work just the same. ( deliv_portable ) Whichever runtime you choose, if you actually try to compile this, you're going to see that you get a warning ( deliv_lint_blocking_fn ): println!("Hello, world!"); ^^^^^^^ synchronous I/O in async fn This is because macros like println! expand to blocking operations, that take control of the underlying thread and don't allow the scheduler to continue. You need to use the async equivalent ( deliv_portable_stdlib ), then await the result: async fn main() { async_println!("Hello, world!").await;
} When you await on something, you are pausing execution and waiting for it to complete before you continue. Under the hood , an await corresponds to giving up the current thread of control so that the runtime can do something else instead while you wait (e.g., process another task).

