So far, using async seems like mostly more work to accomplish the same thing, since you have to add await keywords everywhere. But async functions are like synchronous functions with superpowers: they have the ability to easily compose complex schedules of parallel and concurrent workloads. This is particularly true when you start messing around with asynchronous iterators. Consider this example. Imagine that you have a bunch of networking requests coming in. For each one, you have to do a bit of lightweight preparation, and then some heavyweight processing. This processing can take up a lot of RAM, and takes a while, so you can only process one request at a time, but you would like to do up to 5 instances of that lightweight preparation in parallel while you wait, so that things are all queued up and ready to go. You want a schedule like this, in other words: ┌───────────────┐ │ Preparation 1 │ ─────┐ └───────────────┘ │ │ ┌───────────────┐ │ ┌───────────────┐ │ Preparation 2 │ ─────┼────►│ Process item │ ─────► └───────────────┘ │ └───────────────┘ │ ... │ │ ┌───────────────┐ │ │ Preparation 5 │ ─────┘ └───────────────┘ You can create that quite easily: async fn do_work(database: &Database) { let work = do_select(database, FIND_WORK_QUERY)?; stream::iter(work) .map(async |item| preparation(database, item).await) .buffered(5) .for_each(async |work_item| process_work_item(database, work_item).await) .await;
} The buffered combinator on async iterators creates a schedule that does up to 5 items in parallel, but still produces one item at a time as the result. Thus for_each executes on only one item at a time. How does all this work? The basic AsyncIterator trait ( deliv_async_iter ) looks quite similar to the standard Iterator trait, except that it has an async fn (this fn also has a #[repr] annotation; you can ignore it for now, but we discuss it later). trait AsyncIter { type Item; #[repr(inline)] async fn next(&mut self) -> Self::Item;
} However, when you use combinators like buffered that introduce parallelism, you are now using a parallel async iterator ( deliv_async_iter ), similar to the parallel iterators offered by [rayon]. The core operation here is for_each (which processes each item in the iterator): trait ParAsyncIter { type Item; async fn for_each(&mut self, op: impl AsyncFn(Self::Item));
} Editor's note: There's a subtle difference between for_each here and Rayon's for_each. It might actually be nice to rework Rayon's approach too. Detail hammering still required!

