Async functions work in traits, too ( deliv_async_fn_in_traits ): trait HttpRequest { async fn request(&self, url: &Url) -> HttpResponse;
} Desugaring async fn in traits into impl Trait and generic associated types Async functions actually desugar into functions that return an impl Future. When you use an async function in a trait ( deliv_impl_trait_in_trait ), that is desugared into a (generic) associated type in the trait ( deliv_gats ) whose value is inferred by the compiler ( deliv_tait ): trait SomeTrait { async fn foo(&mut self);
} // becomes: trait SomeTrait { fn foo<(&mut self) -> impl Future<Output = ()> + '_;
} // becomes something like:
//
// Editor's note: The name of the associated type is under debate;
// it may or may not be something user can name, though they should
// have *some* syntax for referring to it. trait SomeTrait { type Foo<'me>: Future<Output = ()> + '_ where Self: 'me; async fn foo(&mut self) -> Self::Foo<'_>;
} What this means is that the future type SomeTrait::Foo is going to be a generated type returned by the compiler that is speciic to that future. Caveat: Gritty details around dyn Trait and no-std However, there is a catch here. When a trait contains async fn, using dyn types (e.g., dyn HttpRequest, for the trait above) can get a bit complicated. ( deliv_dyn_async_trait ) By default, we assume that folks using dyn HttpRequest are doing so in a multithreaded, standard environment. This means that, by default: A reference like &T can only be cast to &dyn HttpRequest if all the async fn in its impl are Send Note that you can still write impls whose async fn are not send, but you cannot use them with dyn (again, by default). Async calls that go through a dyn HttpRequest will allocate a Box to store their data This is usually fine, but in particularly tight loops can be a performance hazard. Note that this only applies when you use dyn HttpRequest; most tight loops tend to use generics like T: HttpRequest anyway, and here there is no issue. These assumptions don't work for everyone, so there are some knobs you can turn: You can request that the futures not be assumed to be Send. You can change the "smart pointer" type used to allocate data; for example, instead of Box, a choice like Stack<32> would stack allocate up to 32 bytes (compilation errors will result if more than 32 bytes are required), and SmallBox<32> would stack allocate up to 32 bytes but heap allocate after that. ( deliv_dyn_async_trait ) You can use 'inline' async functions, though these are not always suitable. (These are covered under "Diving into the details".) The way that all of this is implemented is that users can define their own impls of the form impl Trait for dyn Trait ( deliv_dyn_trait ). This permits us to supply a number of derives that can be used to implement the above options.

