When you run async drop glue, there is an implicit await point. Consider this example: async fn foo(dbc: DatabaseConnection) -> io::Result<()> { let data = socket().read().await?; dbc.write(data).await?;
} Here, presuming that DatabaseConnection implements AsyncDrop, there are actually a number of async drops occurring: async fn foo(dbc: DatabaseConnection) -> io::Result<()> { let data = match socket().read().await { Ok(v) => v, Err(e) => { std::mem::async_drop(dbc).await; return e; } }; let () = match dbc.write(data).await? { Ok(()) => (), Err(e) => { std::mem::async_drop(dbc).await; return e; } }; std::mem::async_drop(dbc).await;
} As this example shows, there are important ergonomic benefits here to implicit async drop, and it also ensures that async and sync code work in analogous ways. However, implicit await points can be a hazard for some applications, where it is important to identify all await points explicitly (for example, authors of embedded applications use await points to reason about what values will be stored in the resulting future vs the stack of the poll function). To further complicate things, async-drop doesn't only execute at the end of a block or an "abrupt" expression like ?: async-drop can also execute at the end of every statement, given temporary values. The best solution here is unclear. We could have an "allow-by-default" lint encouraging explicit use of async_drop, but as the code above shows, the result may be highly unergonomic (also, imagine how it looks as the number of variables requiring async-drop grows). Another option is to target the problem from another angle, for example by adding lints to identify when large values are stored in a future or on the stack, or to allow developers to tag local variables that they expect to be stored on the stack, and have the compiler warn them if this turns out to not be true. Users could then choose how to resolve the problem (for example, by shortening the lifetime of the value so that it is not live across an await).

