Alan decides to try running two async functions concurrently. "This is pretty easy in C#," he thinks, "This can't be too hard in rust." In C# Alan would usually write something like: async Task expensive1() { ...
} async Task expensive2() { ...
} public static async Main() { Task task = expensive1(); await expensive2(); task.Wait();
} If the code was more dynamic, Alan could have also used the Task API to simplify the await: public static Main() { List<Task> tasks = new List<Task>(); tasks.push(expensive1()); tasks.push(expensive2()); try { Task.WaitAll(tasks.ToArray()); } // Ignore exceptions here. catch (AggregateException) {}
} So Alan tries the first approach in rust: use std::sync::mpsc::{self, Sender, Receiver}; async fn expensive1(tx: Sender<()>, rx: Receiver<()>) { println!("Doing expensive work in 1"); tx.send(()).ok(); let _ = rx.recv(); println!("Got result, finishing processing in 1"); println!("1 done");
} async fn expensive2(tx: Sender<()>, rx: Receiver<()>) { println!("Doing simple setup in 2"); let _ = rx.recv(); println!("Got signal from 1, doing expensive processing in 2"); tx.send(()).ok(); println!("2 done");
} #[tokio::main]
async fn main() { let (tx1, rx1) = mpsc::channel(); let (tx2, rx2) = mpsc::channel(); expensive1(tx1, rx2).await; expensive2(tx2, rx1).await;
} But this just hangs after printing: Doing expensive work in 1 Alan wonders if this means he can't run code concurrently... he does some research and learns about join, which doesn't seem to be part of the std. This seems like the second example in C#, but Alan is surprised it doesn't come with the standard library. He has to import futures as a dependency and tries again: use futures::join;
... #[tokio::main]
async fn main() { let (tx1, rx1) = mpsc::channel(); let (tx2, rx2) = mpsc::channel(); let fut1 = expensive1(tx1, rx2); let fut2 = expensive2(tx2, rx1); join!(fut1, fut2);
} But this still hangs the same way as the first attempt. After more research, Alan learns that he can't use the standard mpsc::channel in async contexts. He needs to use the ones in the external futures crate. This requires quite a few changes since the API's don't line up with the one's in std: rx has to be mut there's bounded and unbounded mpsc channels, Alan went with unbounded since the API seemed simpler for now you need to import the StreamExt trait to be able to get a value out of rx, this took a lot of research to get right. use futures::{ join, channel::mpsc::{self, UnoundedSender, UnboundedReceiver}, StreamExt,
};
use std::sync::mpsc::{self, Sender, Receiver}; async fn expensive1(tx: Sender<()>, mut rx: Receiver<()>) { println!("Doing expensive work in 1"); tx.unbounded_send(()).ok(); let _ = rx.next().await; println!("Got result, finishing processing in 1"); println!("1 done");
} async fn expensive2(tx: Sender<()>, mut rx: Receiver<()>) { println!("Doing simple setup in 2"); let _ = rx.next().await; println!("Got signal from 1, doing expensive processing in 2"); tx.unbounded_send(()).ok(); println!("2 done");
} #[tokio::main]
async fn main() { let (tx1, rx1) = mpsc::channel(); let (tx2, rx2) = mpsc::channel(); let fut1 = expensive1(tx1, rx2); let fut2 = expensive2(tx2, rx1); join!(fut1, fut2);
} And now it works! Doing expensive work in 1
Doing simple setup in 2
Got signal from 1, doing expensive processing in 2
2 done
Got result, finishing processing in 1
1 done While this is more similar to using the Task.WaitAll from C#, there were a lot more changes needed than Alan expected.

