} impl<'a, Fut, R, F> AsyncHandlerFn<'a> for F
where F: FnOnce(&'a mut State) -> Fut, R: IntoResponse + 'static, Fut: std::future::Future<Output = Result<R, HandlerError>> + Send + 'a,
{ type Res = R; type Fut = Fut; fn call(self, state: &'a mut State) -> Fut { self(state) }
} pub trait HandlerMarker { fn call_and_wrap(self, state: State) -> Pin<Box<HandlerFuture>>;
} impl<F, R> HandlerMarker for F
where R: IntoResponse + 'static, for<'a> F: AsyncHandlerFn<'a, Res = R> + Send + 'static,
{ fn call_and_wrap(self, mut state: State) -> Pin<Box<HandlerFuture>> { async move { let fut = self.call(&mut state); let result = fut.await; match result { Ok(data) => { let response = data.into_response(&state); Ok((state, response)) } Err(err) => Err((state, err)), } } .boxed() }
} ... fn to_async_borrowing<F>(self, handler: F) where Self: Sized, F: HandlerMarker + Copy + Send + Sync + RefUnwindSafe + 'static, { self.to(move |state: State| handler.call_and_wrap(state)) } Alan is still not sure whether it can be simplified. Later on, other developers on the project attempt to extend this approach to work with closures, but they encounter limitations in rustc that seem to make it not work ( rust-lang/rust#70263 ). When Alan sees another open source project struggling with the same issue, he notices that Barbara has helped them out as well. Alan wonders how many people in the community would be able to write .to_async_borrowing() without help.

