Barbara decides it's not worth the effort to duplicate so much of the crate's functionality, and decides to make the whole library thread-safe: pub struct IpcHandle { cache_storage: Arc<Mutex<IpcCache>>, // ...
} struct IpcCache { /* ... */ } This requires her to migrate her original system service to use multi-threaded types when interacting with the library. Before the change her service uses only single-threaded reference counting and interior mutability: #[derive(Clone)]
struct ClientBroker { state: Rc<RefCell<ClientState>>,
} impl ClientBroker { fn start_serving_clients(self) { let mut ipc_handle = self.make_ipc_handle_for_new_clients(); ipc_handle.spawn_on_reply(move |reply| shared_state.clone().serve_client(reply)); LocalExecutor::new().run_singlethreaded(ipc_handle.listen()); } fn make_ipc_handle_for_new_clients(&self) { /* ... */ } async fn serve_client(self, reply: IpcReply) { /* accesses interior mutability... */ }
