Barbara is working on her YouBuy server and is puzzling over a strange bug report. She is encountering users reporting that their browser connection is timing out when they connect to YouBuy . Based on the logs, she can see that they are timing out in the do_select function: async fn do_select<T>(database: &Database, query: Query) -> Result<Vec<T>> { let conn = database.get_conn().await?; conn.select_query(query).await
} This is surprising, because do_select doesn't do much - it does a database query to claim a work item from a queue, but isn't expected to handle a lot of data or hit extreme slowdown on the database side. Some of the time, there is some kind of massive delay in between the get_conn method opening a connection and the call to select_query. But why? She has metrics that show that the CPU is largely idle, so it's not like the cores are all occupied. She looks at the caller of do_select, which is a function do_work: async fn do_work(database: &Database) { let work = do_select(database, FIND_WORK_QUERY)?; stream::iter(work) .map(|item| do_select(database, work_from_item(item))) .buffered(5) .for_each(|work_item| process_work_item(database, work_item)) .await;
} async fn process_work_item(...) { } The do_work function is invoking do_select as part of a stream; it is buffering up a certain number of do_select instances and, for each one, invoking process_work_item. Everything seems to be in order, and she can see that calls to process_work_item are completing in the logs. Following a hunch, she adds more logging in and around the process_work_item function and waits a few days to accumulate new logs. She notices that shortly after each time out, there is always a log of a process_work_item call that takes at least 20 seconds. These calls are not related to the connections that time out, they are for other connections, but they always appear afterwards in time. process_work_item is expected to be slow sometimes because it can end up handling large items, so this is not immediately surprising to Barbara. She is, however, surprised by the correlation - surely the executor ensures that process_work_item can't stop do_select from doing its job?

