Once Barbara understands the problem, she considers the fix. The most obvious fix is to spawn out tasks for the do_select calls, like so: async fn do_work(database: &Database) { let work = do_select(database, FIND_WORK_QUERY)?; stream::iter(work) .map(|item| task::spawn(do_select(database, work_from_item(item)))) .buffered(5) .for_each(|work_item| process_work_item(database, work_item)) .await;
} Spawning a task will allow the runtime to keep moving those tasks along independently of the do_work task. Unfortunately, this change results in a compilation error: error[E0759]: `database` has an anonymous lifetime `'_` but it needs to satisfy a `'static` lifetime requirement --> src/main.rs:8:18 |
8 | async fn do_work(database: &Database) { | ^^^^^^^^ --------- this data with an anonymous lifetime `'_`... | | | ...is captured here... | .map(|item| task::spawn(do_select(database, work_from_item(item)))) | ----------- ...and is required to live as long as `'static` here "Ah, right," she says, "spawned tasks can't use borrowed data. I wish I had [rayon] or the scoped threads from [crossbeam]." "Let me see," Barbara thinks. "What else could I do?" She has the idea that she doesn't have to process the work items immediately. She could buffer up the work into a FuturesUnordered and process it after everything is ready: async fn do_work(database: &Database) { let work = do_select(database, FIND_WORK_QUERY)?; let mut results = FuturesUnordered::new(); stream::iter(work) .map(|item| do_select(database, work_from_item(item))) .buffered(5) .for_each(|work_item| { results.push(process_work_item(database, work_item)); futures::future::ready(()) }) .await; while let Some(_) = results.next().await { }
} This changes the behavior of her program quite a bit though. The original goal was to have at most 5 do_select calls occurring concurrently with exactly one process_work_item, but now she has all of the process_work_item calls executing at once. Nonetheless, the hack solves her immediate problem. Buffering up work into a FuturesUnordered becomes a kind of "fallback" for those cases where can't readily insert a task::spawn.

