Write your story here! Feel free to add subsections, citations, links, code examples, whatever you think is best. Barbara is implementing the network stack for an experimental new operating system in Rust. She loves Rust's combination of performance, expressiveness, and safety. She and her team set off implementing the network protocols, using traits to separate protocol layers, break up the work, and make them testable. Unlike most operating systems, this network stack is designed to live in a separate process from the driver itself. Barbara eventually realizes a problem: this system architecture will require modeling backpressure explicitly when sending outbound packets. She starts looking into how to model backpressure without having to rewrite all of her team's code. She realizes that async is actually the perfect model for expressing backpressure implicitly. By using async, she can keep most of her code without explicitly propagating backpressure information. When she sets off to implement this, Barbara quickly realizes async won't work off the shelf because of the lack of support for async fn in traits. Barbara is stuck. She has a large codebase that she would like to convert to using async, but core features of the language she was using are not available with async. She starts looking for workarounds. Barbara begins by writing out requirements for her use case. She needs to Continue using trait abstractions for core protocol implementations Take advantage of the backpressure model implied by async Maintain performance target of at most 4 µs per packet on underpowered hardware The last requirement is important for sustaining gigabit speeds, a key goal of the network stack and one reason why Rust was chosen. Barbara thinks about writing down the name of each Future type, but realizes that this wouldn't work with the async keyword. Using Future combinators directly would be extremely verbose and painful. Barbara finds the async_trait crate. Given her performance constraints, she is wary of the allocations and dynamic dispatch introduced by the crate. She decides to write a benchmark to simulate the performance impact of async_trait compared to a future where async fn is fully supported in traits. Looking at the async_trait documentation, she sees that it desugars code like #[async_trait]
impl Trait for Foo { async fn run(&self) { // ... }
} to impl Trait for Foo { fn run<'a>( &'a self, ) -> Pin<Box<dyn std::future::Future<Output = ()> + Send + 'a>> where Self: Sync + 'a, { async fn run(_self: &Foo) { // original body } Box::pin(run(self)) }
} The benchmark Barbara uses constructs a tree of Futures 5 levels deep, using both async blocks and a manual desugaring similar to above. She runs the benchmark on hardware that is representative for her use case and finds that while executing a single native async future takes 639 ns, the manual desugaring using boxed takes 1.82 µs. Barbara sees that in a real codebase, this performance would not be good enough for writing a network stack capable of sustaining gigabit-level throughput on underpowered hardware. Barbara is disappointed, but knows that support for async fn in traits is in the works. Barbara looks at her organization's current priorities and decides that 100's of mbps will be an acceptable level of performance for the near term. She decides to adopt async_trait with the expectation that the performance penalty will go away in the long term.

