Barbara wants to set priorities to the tasks spawned to the executor. However, she finds no existing async executor provides such a feature She would be more than happy to enhance an existing executor and even intends to do so at some point. At the same time, Barbara understand that the process of getting changes merged officially into an executor can be long, and for good reason. Due to pressure and deadlines at work she needs a first version to be working as soon as possible. She then decides to build her own async executor. First, Barbara found crossbeam-deque provides work-stealing deques of good quality. She decides to use it to build task schedulers. She plans for each working thread to have a loop which repeatedly gets a task from the deque and polls it. But wait, what should we put into those queues to represent each "task"? At first, Barbara thought it must contain the Future itself and the additional priority which was used by the scheduler. So she first wrote: pub struct Task { future: Pin<Box<dyn Future<Output = ()> + Send + 'static>>, priority: u8
} And the working thread loop should run something like: pub fn poll_task(task: Task) { let waker = todo!(); let mut cx = Context::from_waker(&waker); task.future.as_mut().poll(&mut cx);
} "How do I create a waker?" Barbara asked herself. Quickly, she found the Wake trait. Seeing the wake method takes an Arc<Self>, she realized the task in the scheduler should be stored in an Arc. After some thought, she realizes it makes sense because both the deque in the scheduler and the waker may hold a reference to the task. To implement Wake, the Task should contain the sender of the scheduler. She changed the code to something like this: pub struct Task { future: Pin<Box<dyn Future<Output = ()> + Send + 'static>>, scheduler: SchedulerSender, priority: u8,
} unsafe impl Sync for Task {} impl Wake for Task { fn wake(self: Arc<Self>) { self.scheduler.send(self.clone()); }
} pub fn poll_task(task: Arc<Task>) { let waker = Waker::from(task.clone()); let mut cx = Context::from_waker(&waker); task.future.as_mut().poll(&mut cx);
// ^^^^^^^^^^^ cannot borrow as mutable
} The code still needed some change because the future in the Arc<Task> became immutable. "Okay. I can guarantee Task is created from a Pin<Box<Future>>, and I think the same future won't be polled concurrently in two threads. So let me bypass the safety checks." Barbara changed the future to a raw pointer and confidently used some unsafe blocks to make it compile. pub struct Task { future: *mut (dyn Future<Output = ()> + Send + 'static), ...
} unsafe impl Send for Task {}
unsafe impl Sync for Task {} pub fn poll_task(task: Arc<Task>) { ... unsafe { Pin::new_unchecked(&mut *task.future).poll(&mut cx); }
} Luckily, a colleague of Barbara noticed something wrong. The wake method could be called multiple times so multiple copies of the task could exist in the scheduler. The scheduler might not work correctly because of this. What's worse, a more severe problem was that multiple threads might get copies of the same task from the scheduler and cause a race in polling the future. Barbara soon got a idea to solve it. She added a state field to the Task. By carefully maintaining the state of the task, she could guarantee there are no duplicate tasks in the scheduler and no race can happen when polling the future. const NOTIFIED: u64 = 1;
const IDLE: u64 = 2;
const POLLING: u64 = 3;
const COMPLETED: u64 = 4; pub struct Task { ... state: AtomicU64,
} impl Wake for Task { fn wake(self: Arc<Self>) { let mut state = self.state.load(Relaxed); loop { match state { // To prevent a task from appearing in the scheduler twice, only send the task // to the scheduler if the task is not notified nor being polling. IDLE => match self .state .compare_exchange_weak(IDLE, NOTIFIED, AcqRel, Acquire) { Ok(_) => self.scheduler.send(self.clone()), Err(s) => state = s, }, POLLING => match self .state .compare_exchange_weak(POLLING, NOTIFIED, AcqRel, Acquire) { Ok(_) => break, Err(s) => state = s, }, _ => break, } } }
} pub fn poll_task(task: Arc<Task>) { let waker = Waker::from(task.clone()); let mut cx = Context::from_waker(&waker); loop { // We needn't read the task state here because the waker prevents the task from // appearing in the scheduler twice. The state must be NOTIFIED now. task.state.store(POLLING, Release); if let Poll::Ready(()) = unsafe { Pin::new_unchecked(&mut *task.future).poll(&mut cx) } { task.state.store(COMPLETED, Release); } match task.state.compare_exchange(POLLING, IDLE, AcqRel, Acquire) { Ok(_) => break, Err(NOTIFIED) => continue, _ => unreachable!(), } }
} Barbara finished her initial implementation of the async executor. Despite there were a lot more possible optimizations, Barbara already felt it is a bit complex. She was also confused about why she needed to care so much about polling and waking while her initial requirement was just adding additional information to the task for customizing scheduling.

668.body:
Barbara is contributing to an OS that supports running multiple applications on a single microcontroller. These microcontrollers have as little as 10's of kilobytes of RAM and 100's of kilobytes of flash memory for code. Barbara is writing a library that is used by multiple applications -- and is linked into each application -- so the library is very resource constrained. The library should support asynchronous operation, so that multiple APIs can be used in parallel within each (single-threaded) application. Barbara begins writing the library by trying to write a console interface, which allows byte sequences to be printed to the system console. Here is an example sequence of events for a console print: The interface gives the kernel a callback to call when the print finishes, and gives the kernel the buffer to print. The kernel prints the buffer in the background while the app is free to do other things. The print finishes. The app tells the kernel it is ready for the callback to be invoked, and the kernel invokes the callback. Barbara tries to implement the API using core::future::Future so that the library can be compatible with the async Rust ecosystem. The OS kernel does not expose a Future-based interface, so Barbara has to implement Future by hand rather than using async/await syntax. She starts with a skeleton: /// Passes `buffer` to the kernel, and prints it to the console. Returns a
/// future that returns `buffer` when the print is complete. The caller must
/// call kernel_ready_for_callbacks() when it is ready for the future to return. fn print_buffer(buffer: &'static mut [u8]) -> PrintFuture { // TODO: Set the callback // TODO: Tell the kernel to print `buffer`
} struct PrintFuture; impl core::future::Future for PrintFuture { type Output = &'static mut [u8]; fn poll(self: Pin<&mut Self>, cx: &mut Context) -> Poll<Self::Output> { // TODO: Detect when the print is done, retrieve `buffer`, and return // it. }
} Note: All error handling is omitted to keep things understandable. Barbara begins to implement print_buffer: fn print_buffer(buffer: &'static mut [u8]) -> PrintFuture { kernel_set_print_callback(callback); kernel_start_print(buffer); PrintFuture {}
} // New! The callback the kernel calls.
extern fn callback() { // TODO: Wake up the currently-waiting PrintFuture.
} So far so good. Barbara then works on poll: fn poll(self: Pin<&mut Self>, cx: &mut Context) -> Poll<Self::Output> { if kernel_is_print_done() { return Poll::Ready(kernel_get_buffer_back()); } Poll::Pending } Of course, there's something missing here. How does the callback wake the PrintFuture? She needs to store the Waker somewhere! Barbara puts the Waker in a global variable so the callback can find it (this is fine because the app is single threaded and callbacks do NOT interrupt execution the way Unix signals do): static mut PRINT_WAKER: Option<Waker> = None; extern fn callback() { if let Some(waker) = unsafe { PRINT_WAKER.as_ref() } { waker.wake_by_ref(); }
} She then modifies poll to set PRINT_WAKER: fn poll(self: Pin<&mut Self>, cx: &mut Context) -> Poll<Self::Output> { if kernel_is_print_done() { return Poll::Ready(kernel_get_buffer_back()); } unsafe { PRINT_WAKER = Some(cx.waker()); } Poll::Pending } PRINT_WAKER is stored in .bss, which occupies space in RAM but not flash. It is two words in size. It points to a RawWakerVTable that is provided by the executor. RawWakerVTable's design is a compromise that supports environments both with and without alloc. In no-alloc environments, drop and clone are generally no-ops, and wake/wake_by_ref seem like duplicates. Looking at RawWakerVTable makes Barbara realize that even though Future was designed to work in embedded contexts, it may have too much overhead for her use case. Barbara decides to do some benchmarking. She comes up with a sample application -- an app that blinks a led and responds to button presses -- and implements it twice. One implementation does not use Future at all, the other does. Both implementations have two asynchronous interfaces: a timer interface and a GPIO interface, as well as an application component that uses the interfaces concurrently. In the Future-based app, the application component functions like a future combinator, as it is a Future that is almost always waiting for a timer or GPIO future to finish. To drive the application future, Barbara implements an executor. The executor functions like a background thread. Because alloc is not available, this executor contains a single future. The executor has a spawn function that accepts a future and starts running that future (overwriting the existing future in the executor if one is already present). Once started, the executor runs entirely in kernel callbacks. Barbara identifies several factors that add branching and error handling code to the executor: spawn should be a safe function, because it is called by high-level application code. However, that means it can be called by the future it contains. If handled naively, this would result in dropping the future while it executes. Barbara adds runtime checks to identify this situation. Waker is Sync, so on a multithreaded system, a future could give another thread access to its Waker and the other thread could wake it up. This could happen while the poll is executing, before poll returns Poll::Pending. Therefore, Barbara concludes that if wake is called while a future is being polled then the future should be re-polled, even if the current poll returns Poll::Pending. This requires putting a retry loop into the executor. A kernel callback may call Waker::wake after its future returns Poll::Ready. After poll returns Poll::Ready, the executor should not poll the future again, so Barbara adds code to ignore those wakeups. This duplicates the "ignore spurious wakeups" functionality that exists in the future itself. Ultimately, this made the executor logic nontrivial, and it compiled into 96 bytes of code. The executor logic is monomorphized for each future, which allows the compiler to make inlining optimizations, but results in a significant amount of duplicate code. Alternatively, it could be adapted to use function pointers or vtables to avoid the code duplication, but then the compiler definitely cannot inline Future::poll into the kernel callbacks. Barbara publishes an analysis of the relative sizes of the two app implementations, finding a large percentage increase in both code size and RAM usage (note: stack usage was not investigated). Most of the code size increase is from the future combinator code. In the no-Future version of the app, a kernel callback causes the following: The kernel callback calls the application logic's event-handling function for the specific event type. The application handles the event. The call in step 1 is inlined, so the compiled kernel callback consists only of the application's event-handling logic. In the Future-based version of the app, a kernel callback causes the following: The kernel callback updates some global state to indicate the event happened. The kernel callback invokes Waker::wake. Waker::wake calls poll on the application future. The application future has to look at the state saved in step 1 to determine what event happened. The application future handles the event. LLVM is unable to devirtualize the call in step 2, so the optimizer is unable to simplify the above steps. Steps 1-4 only exist in the future-based version of the code, and add over 200 bytes of code (note: Barbara believes this could be reduced to between 100 and 200 bytes at the expense of execution speed). Barbara concludes that Future is not suitable for highly-resource-constrained environments due to the amount of code and RAM required to implement executors and combinators. Barbara redesigns the library she is building to use a different concept for implementing async APIs in Rust that are much lighter weight. She has moved on from Future and is refining her async traits instead. Here are some ways in which these APIs are lighter weight than a Future implementation: After monomorphization, kernel callbacks directly call application code. This allows the application code to be inlined into the kernel callback. The callback invocation is more precise: these APIs don't make spurious wakeups, so application code does not need to handle spurious wakeups. The async traits lack an equivalent of Waker. Instead, all callbacks are expected to be 'static (i.e. they modify global state) and passing pointers around is replaced by static dispatch.

679.body:
Barbara is recreating some code that has been written in other languages they have some familiarity with. These include C++, but also GC'd languages like Python. This code collates a large number of requests to network services, with each response containing a large amount of data. To speed this up, Barbara uses buffer_unordered, and writes code like this: let mut queries = futures::stream::iter(...) .map(|query| async move { let d: Data = self.client.request(&query).await?; d }) .buffer_unordered(32); use futures::stream::StreamExt;
let results = queries.collect::<Vec<Data>>().await; Barbara thinks this is similar in function to things she has seen using Python's asyncio.wait , as well as some code her coworkers have written using c++20's coroutines, using this : std::vector<folly::coro::Task<Data>> tasks; for (const auto& query : queries) { tasks.push_back( folly::coro::co_invoke([this, &query]() -> folly::coro::Task<Data> { co_return co_await client_->co_request(query); } )
}
auto results = co_await folly:coro::collectAllWindowed( move(tasks), 32); However, the Rust code performs quite poorly compared to the other impls, appearing to effectively complete the requests serially, despite on the surface looking like effectively identical code. While investigating, Barbara looks at top, and realises that her coworker's C++20 code sometimes results in her 16 core laptop using 1600% CPU; her Rust async code never exceeds 100% CPU usage. She spends time investigating her runtime setup, but Tokio is configured to use enough worker threads to keep all her CPU cores busy. This feels to her like a bug in buffer_unordered or tokio, needing more time to investigate. Barbara goes deep into investigating this, spends time reading how buffer_unordered is implemented, how its underlying FuturesUnordered is implemented, and even thinks about how polling and the tokio runtime she is using works. She evens tries to figure out if the upstream service is doing some sort of queueing. Eventually Barbara starts reading more about c++20 coroutines, looking closer at the folly implementation used above, noticing that is works primarily with tasks , which are not exactly equivalent to rust Future's. Then it strikes her! request is implemented something like this: impl Client { async fn request(&self) -> Result<Data> { let bytes = self.inner.network_request().await? Ok(serialization_libary::from_bytes(&bytes)?) }
} The results from the network service are sometimes (but not always) VERY large, and the BufferedUnordered stream is contained within 1 tokio task. The request future does non-trivial cpu work to deserialize the data. This causes significant slowdowns in wall-time as the the process CAN BE bounded by the time it takes the single thread running the tokio-task to deserialize all the data. This problem hadn't shown up in test cases, where the results from the mocked network service are always small; many common uses of the network service only ever have small results, so it takes a specific production load to trigger this issue, or a large scale test. The solution is to spawn tasks (note this requires 'static futures): let mut queries = futures::stream::iter(...) .map(|query| async move { let d: Data = tokio::spawn( self.client.request(&query)).await??; d }) .buffer_unordered(32); use futures::stream::StreamExt;
let results = queries.collect::<Vec<Data>>().await; Barbara was able to figure this out by reading enough and trying things out, but had that not worked, it would have probably required figuring out how to use perf or some similar tool. Later on, Barbara gets surprised by this code again. It's now being used as part of a system that handles a very high number of requests per second, but sometimes the system stalls under load. She enlists Grace to help debug, and the two of them identify via perf that all the CPU cores are busy running serialization_libary::from_bytes. Barbara revisits this solution, and discovers tokio::task::block_in_place which she uses to wrap the calls to serialization_libary::from_bytes: impl Client { async fn request(&self) -> Result<Data> { let bytes = self.inner.network_request().await? Ok(tokio::task::block_in_place(move || serialization_libary::from_bytes(&bytes))?) }
} This resolves the problem as seen in production, but leads to Niklaus's code review suggesting the use of tokio::task::spawn_blocking inside request, instead of spawn inside buffer_unordered. This discussion is challenging, because the tradeoffs between spawn on a Future including block_in_place and spawn_blocking and then not spawning the containing Future are subtle and tricky to explain. Also, either block_in_place and spawn_blocking are heavyweight and Barbara would prefer to avoid them when the cost of serialization is low, which is usually a runtime-property of the system.

