712.body:
Barbara , an experienced Rust user, is prototyping an async Rust service for work. To get things working quickly, she decides to prototype in tokio , since it is unclear which runtime her work will use. She starts adding warp and tokio to her dependencies list. She notices that warp suggests using tokio with the full feature. She's a bit concerned about how this might affect the compile times and also that all of tokio is needed for her little project, but she pushes forward. As she builds out functionality, she's pleased to see tokio provides a bunch of helpers like join! and async versions of the standard library types like channels and mutexes. After completing one endpoint, she moves to a new one which requires streaming http responses to the client. Barbara quickly finds out from tokio docs , that it does not provide a stream type, and so she adds tokio-stream to her dependencies. Moving on she tries to make some functions generic over the web framework underneath, so she tries to abstract off the functionality to a trait. So she writes an async function inside a trait, just like a normal function. trait Client { async fn get();
} Then she gets a helpful error message. error[E0706]: functions in traits cannot be declared `async` --> src/lib.rs:2:5 |
2 | async fn get(); | -----^^^^^^^^^^ | | | `async` because of this | = note: `async` trait functions are not currently supported = note: consider using the `async-trait` crate: https://crates.io/crates/async-trait She then realizes that Rust doesn't support async functions in traits yet, so she adds async-trait to her dependencies. Some of her functions are recursive, and she wanted them to be async functions, so she sprinkles some async/.await keywords in those functions. async fn sum(n: usize) -> usize { if n == 0 { 0 } else { n + sum(n - 1).await }
} Then she gets an error message. error[E0733]: recursion in an `async fn` requires boxing --> src/lib.rs:1:27 |
1 | async fn sum(n: usize) -> usize { | ^^^^^ recursive `async fn` | = note: a recursive `async fn` must be rewritten to return a boxed `dyn Future` So to make these functions async she starts boxing her futures the hard way, fighting with the compiler. She knows that async keyword is sort of a sugar for impl Future so she tries the following at first. fn sum(n: usize) -> Box<dyn Future<Output = usize>> { Box::new(async move { if n == 0 { 0 } else { n + sum(n - 1).await } })
} The compiler gives the following error. error[E0277]: `dyn Future<Output = usize>` cannot be unpinned --> src/main.rs:11:17 |
11 | n + sum(n - 1).await | ^^^^^^^^^^^^^^^^ the trait `Unpin` is not implemented for `dyn Future<Output = usize>` | = note: required because of the requirements on the impl of `Future` for `Box<dyn Future<Output = usize>>` = note: required by `poll` She then reads about Unpin and Pin, and finally comes up with a solution. fn sum(n: usize) -> Pin<Box<dyn Future<Output = usize>>> { Box::pin(async move { if n == 0 { 0 } else { n + sum(n - 1).await } })
} The code works! She searches online for better methods and finds out the async-book . She reads about recursion and finds out a cleaner way using the futures crate. use futures::future::{BoxFuture, FutureExt}; fn sum(n: usize) -> BoxFuture<'static, usize> { async move { if n == 0 { 0 } else { n + sum(n - 1).await } }.boxed()
} She also asks one of her peers for a code review asynchronously, and after awaiting their response, she learns about the async-recursion crate. Then she adds async-recursion to the dependencies. Now she can write the following, which seems reasonably clean: #[async_recursion]
async fn sum(n: usize) -> usize { if n == 0 { 0 } else { n + sum(n - 1).await }
} As she is working, she realizes that what she really needs is to write a Stream of data. She starts trying to write her Stream implementation and spends several hours banging her head against her desk in frustration (her challenges are pretty similar to what Alan experienced ). Ultimately she's stuck trying to figure out why her &mut self.foo call is giving her errors: error[E0277]: `R` cannot be unpinned --src/main.rs:52:26 |
52 | Pin::new(&mut self.reader).poll_read(cx, buf) | ^^^^^^^^^^^^^^^^ the trait `Unpin` is not implemented for `R` | = note: required by `Pin::<P>::new`
help: consider further restricting this bound |
40 | R: AsyncRead + Unpin, | ^^^^^^^ Fortunately, that weekend, @fasterthanlime publishes a blog post covering the gory details of Pin. Reading that post, she learns about pin-project , which she adds as a dependency. She's able to get her code working, but it's kind of a mess. Feeling quite proud of herself, she shows it to a friend, and they suggest that maybe she ought to try the async-stream crate. Reading that, she realizes she can use this crate to simplify some of her streams, though not all of them fit. "Finally!", Barbara says, breathing a sigh of relief. She is done with her prototype, and shows it off at work, but to her dismay, the team decides that they need to use a custom runtime for their use case. They're building an embedded system and it has relatively limited resources. Barbara thinks, "No problem, it should be easy enough to change runtimes, right?" So now Barbara starts the journey of replacing tokio with a myriad of off the shelf and custom helpers. She can't use warp so now she has to find an alternative. She also has to find a new channel implementations and there are a few: In futures async-std has one, but it seems to be tied to another runtime so she can't use that. smol has one that is independent. This process of "figure out which alternative is an option" is repeated many times. She also tries to use the select! macro from futures but it requires more pinning and workarounds (not to mention a stack overflow or two). But Barbara fights through all of it. In the end, she gets it to work, but she realizes that she has a ton of random dependencies and associated compilation time. She wonders if all that dependencies will have a negative effect on the binary size. She also had to rewrite some bits of functionality on her own.

722.body:
Barbara has been following async rust for a long time, in eager anticipation of writing some project using async. The last time she tried to do anything with futures in rust was more than a year ago (before async functions), and when you had to chain futures together with many calls to then (often leading to inscrutable error messages hundreds of characters long). This was not a pleasant experience for Barbara. After watching the development of rust async/await (by following discussions on /r/rust and the internals forums), she wants to start to play around with writing async code. Before starting on any real project, she starts with a "playground" where she can try to write some simple async rust code to see how it feels and how it compares to how async code feels in other languages she knows (like C# and JavaScript). She starts by opening a blank project in VSCode with rust-analyzer . Because she's been following the overall state of rust async, she knows that she needs a runtime, and quickly decides to use tokio, because she knows its quite popular and well documented. After looking the long length of the tokio tutorial , she decides to not read most of it right now, and tries to dive right in to writing code. But she does look at the " Hello Tokio " section that shows what feature flags are required by tokio: [dependencies]
tokio = { version = "1", features = ["full"] } Poking around the tokio API docs in search of something to play with, she sees a simple future that looks interesting: the sleep future that will wait for a certain duration to elapse before resolving. Borrowing again from the "Hello Tokio" tutorial to make sure she has the correct spelling for the tokio macros, she writes up the following code: #[tokio::main]
pub async fn main() { let mut rng = thread_rng(); let t = Uniform::new(100, 5000); let mut futures = Vec::new(); for _ in 0..10 { let delay = rng.sample(t); futures.push(tokio::time::sleep(Duration::from_millis(delay))); } println!("Created 10 futures"); for f in futures { f.await; } println!("Done waiting for all futures");
} This very first version she wrote compiled on the first try and had no errors when running it. Barbara was pleased about this. However, this example is pretty boring. The program just sits there for a few seconds doing nothing, and giving no hints about what it's actually doing. So for the next iteration, Barbara wants to have a message printed out when each future is resolved. She tries this code at first: let mut futures = Vec::new();
for _ in 0..10 { let delay = rng.sample(t); futures.push(tokio::time::sleep(Duration::from_millis(delay)).then(|_| { println!("Done!"); }));
}
println!("Created 10 futures"); But the compiler gives this error: error[E0277]: `()` is not a future --> src\main.rs:13:71 |
