In this minimized example of code to interface a stream to code outside of the async/await system, the buffer has to be accessible from both the stream and the outside code, so it is handled as a Rc<RefCell<StreamBuffer<T>>>. pub struct StreamPipe<T> { buf: Rc<RefCell<StreamBuffer<T>>>, req_more: Rc<dyn Fn()>,
} impl<T> Stream for StreamPipe<T> { type Item = T; fn poll_next(self: Pin<&mut Self>, _: &mut Context<'_>) -> Poll<Option<T>> { let mut buf = self.buf.borrow_mut(); if let Some(item) = buf.value.take() { return Poll::Ready(Some(item)); } if buf.end { return Poll::Ready(None); } (self.req_more)(); // Callback to request more data Poll::Pending }
} Probably req_more() has to schedule some background operation, but if it doesn't and attempts to modify the shared buf immediately then we get a panic, because buf is still borrowed. The real life code could be a lot more complicated, and the required combination of conditions might be harder to hit in testing. With statically-checked borrowing, the borrow would be something like let mut buf = self.buf.rw(cx);, and the req_more call would either have to take the cx as an argument (forcing the previous borrow to end) or would not take cx, meaning that it would always have to defer the access to the buffer to other code, because without the cx there is no possible way to access the buffer.

