In this example, the app keeps tallies of various things in a Monitor structure. This might be data in/out, number of errors detected, maybe a hashmap of current links, etc. Since it is accessed from various components, it is kept behind an Rc<RefCell<_>>. // Dependency: futures-lite = "1.11.3"
use std::cell::RefCell;
use std::rc::Rc; fn main() { let monitor0 = Rc::new(RefCell::new(Monitor { count: 0 })); let monitor1 = monitor0.clone(); let fut0 = async move { let mut borrow = monitor0.borrow_mut(); borrow.count += 1; }; let fut1 = async move { let mut borrow = monitor1.borrow_mut(); borrow.count += 1; fut0.await; }; futures_lite::future::block_on(fut1);
} struct Monitor { count: usize,
} The problem is that this panics with a borrowing error because the borrow is still active when the fut0.await executes and attempts another borrow. The solution is to remember to drop the borrow before awaiting. In this example code the bug is obvious, but in real life maybe fut0 only borrows in rare situations, e.g. when an error is detected. Or maybe the future that borrows is several calls away down the callstack. With statically-checked borrowing, there is a slight problem in that currently there is no way to access the poll context from async {} code. But if there was then the borrow would be something like let mut borrow = monitor1.rw(cx);, and since the fut0.await implicitly requires the cx in order to poll, the borrow would be forced to end at that point.

