Barbara understands that statically-checked cell borrows work by having an owner held by the runtime, and various instances of a cell held by things running on top of the runtime (these cells would typically be behind Rc references). A mutable borrow on the owner is passed down the stack, which enables safe borrows on all the cells, since a mutable borrow on a cell is enabled by temporarily holding onto the mutable borrow of the owner, which is all checked at compile-time. So the mutable owner borrow needs to be passed through the poll call, and Barbara realizes that this would require support from the standard library. Right now a &mut Context<'_> is passed to poll, and so within Context would be the ideal place to hold a borrow on the cell owner. However as far as Barbara can see there are difficulties with all the current implementations: GhostCell (or qcell::LCell) may be the best available solution, because it doesn't have any restrictions on how many runtimes might be running or how they might be nested. But Rust insists that the lifetimes <'id> on methods and types are explicit, so it seems like that would force a change to the signature of poll, which would break the ecosystem. Here Barbara experiments with a working example of a modified Future trait and a future implementation that makes use of LCell: // Requires dependency: qcell = "0.4"
use qcell::{LCell, LCellOwner};
use std::pin::Pin;
use std::rc::Rc;
use std::task::Poll; struct Context<'id, 'a> { cell_owner: &'a mut LCellOwner<'id>,
} struct AsyncCell<'id, T>(LCell<'id, T>);
impl<'id, T> AsyncCell<'id, T> { pub fn new(value: T) -> Self { Self(LCell::new(value)) } pub fn rw<'a, 'b: 'a>(&'a self, cx: &'a mut Context<'id, 'b>) -> &'a mut T { cx.cell_owner.rw(&self.0) }
} trait Future<'id> { type Output; fn poll(self: Pin<&mut Self>, cx: &mut Context<'id, '_>) -> Poll<Self::Output>;
} struct MyFuture<'id> { count: Rc<AsyncCell<'id, usize>>,
}
impl<'id> Future<'id> for MyFuture<'id> { type Output = (); fn poll(self: Pin<&mut Self>, cx: &mut Context<'id, '_>) -> Poll<Self::Output> { *self.count.rw(cx) += 1; Poll::Ready(()) }
} fn main() { LCellOwner::scope(|mut owner| { let mut cx = Context { cell_owner: &mut owner }; let count = Rc::new(AsyncCell::new(0_usize)); let mut fut = Box::pin(MyFuture { count: count.clone() }); let _ = fut.as_mut().poll(&mut cx); assert_eq!(1, *count.rw(&mut cx)); });
} The other qcell types (QCell, TCell and TLCell) have various restrictions or overheads which might make them unsuitable as a general-purpose solution in the standard library. However they do have the positive feature of not requiring any change in the signature of poll. It looks like they could be added to Context without breaking anything. Here Barbara tries using TLCell, and finds that the signature of poll doesn't need to change: // Requires dependency: qcell = "0.4"
use qcell::{TLCell, TLCellOwner};
use std::pin::Pin;
use std::rc::Rc;
use std::task::Poll; struct AsyncMarker;
struct Context<'a> { cell_owner: &'a mut TLCellOwner<AsyncMarker>,
} struct AsyncCell<T>(TLCell<AsyncMarker, T>);
impl<T> AsyncCell<T> { pub fn new(value: T) -> Self { Self(TLCell::new(value)) } pub fn rw<'a, 'b: 'a>(&'a self, cx: &'a mut Context<'b>) -> &'a mut T { cx.cell_owner.rw(&self.0) }
} trait Future { type Output; fn poll(self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<Self::Output>;
} struct MyFuture { count: Rc<AsyncCell<usize>>,
}
impl Future for MyFuture { type Output = (); fn poll(self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<Self::Output> { *self.count.rw(cx) += 1; Poll::Ready(()) }
} fn main() { let mut owner = TLCellOwner::new(); let mut cx = Context { cell_owner: &mut owner }; let count = Rc::new(AsyncCell::new(0_usize)); let mut fut = Box::pin(MyFuture { count: count.clone() }); let _ = fut.as_mut().poll(&mut cx); assert_eq!(1, *count.rw(&mut cx));
} (For comparison, TCell only allows one owner per marker type in the whole process. QCell allows many owners, but requires a runtime check to make sure you're using the right owner to access a cell. TLCell allows only one owner per thread per marker type, but also lets cells migrate between threads and be borrowed locally, which the others don't -- see qcell docs .) So the choice is GhostCell/LCell and lifetimes everywhere, or various other cell types that may be too restrictive. Right now Barbara thinks that none of these solutions is likely to be acceptable for the standard library. However still it is a desirable feature, so maybe someone can think of a way around the problems. Or maybe someone has a different perspective on what would be acceptable.

