Doing this a single time is fine, but an end goal of the project is to be able to stream frames from the camera for unspecified lengths of time. Grace spends some time searching, and realizes that what she actually wants is a Stream of some kind. Stream objects are the asynchronous equivalent of iterators, and her team wants to eventually write something akin to: let frame_stream = stream_from_camera(camera, Duration::from_millis(5)); while let Some(frame) = frame_stream.next().await { // process frames
} println!("Frame stream closed."); She scours existing crates, in particular looking for one way to transform the above future into a stream that can be executed many times. The only available option to transform a future into a series of futures is stream::unfold , which seems to do exactly what Grace is looking for. Grace begins by adding a small intermediate type, and then plugging in the remaining holes: struct StreamState { camera: Camera, retry_after: Duration,
} fn stream_from_camera(camera: Camera, retry_after: Duration) -> Unfold<Frame, ??, ??> { let initial_state = StreamState { camera, retry_after }; stream::unfold(initial_state, |state| async move { let frame = next_frame(&state.camera, state.retry_after).await (frame, state) })
} This looks like it mostly hits the mark, but Grace is left with a couple of questions for how to get the remainder of this building: What is the type that fills in the third template parameter in the return? It should be the type of the future that is returned by the async closure passed into stream::unfold, but we don't know the type of a closure! What is the type that fills in the second template parameter of the closure in the return? Grace spends a lot of time trying to figure out how she might find those types! She asks Barbara what the idiomatic way to get around this in Rust would be. Barbara explains again how closures don't have concrete types, and that the only way to do this will be to use the impl keyword. fn stream_from_camera(camera: Camera, retry_after: Duration) -> impl Stream<Item = Frame> { // same as before
} While Grace was was on the correct path and now her team is able to write the code they want to, she realizes that sometimes writing the types out explicitly can be very hard. She reflects on what it would have taken to write the type of an equivalent function pointer in C, and slightly laments that Rust cannot express such as clearly.

889.body:
Alan is trying to pick up Rust, and wants to build a command-line web scraper since it's a project he's recently written in Go. The program takes a URL, and recursively downloads all URLs named in all fetched pages. Alan goes to crates.io and searches for "http client", and finds a library called reqwest. He opens its documentation, and sees that the library has him choose between an "async" and a "blocking" client. Confused, Alan types in "rust async" in his favorite search engine, and finds the Rust async book . On the very first page there's a summary of where async is useful and where it's not, as well as some of the downsides of each approach. Alan sees that for "make a single web request", async is not generally necessary, whereas for "making many network requests concurrently" async is recommended. Since Alan expects his crawler to make many requests, he decides he probably wants async for this application. The async book tells Alan that he should mark his main function as async fn, so he does. He then follows the reqwest async examples, and is able to successfully make his crawler download a single web page. Next, he wants to parse each page to extract additional URLs to fetch. So, he finds a library that can parse HTML, quick-xml. He sets up his application with a HashSet to store all the yet-to-be-parsed URLs, and then writes a loop that pulls out a URL from the set, issues a HTTP request, awaits the response bytes, and passes them to quick-xml. Alan first tried to give the http::Response directly to quick_xml::Reader::from_reader, but the compiler told him: error: This type does not implement `Read`, which is required by `Reader::from_reader`. let page = Reader::from_reader(request.await?); ^^^^^^^^^^^^^^ help: The type does implement `AsyncRead`, but the method does not support asynchronous inputs.
suggestion: Use a method that supports asynchronous readers or read the data to a `Vec<u8>` first, and then pass that to `Reader::from_reader` instead (`Vec<u8>` implements `Read`). Alan has his program iterate over all the links on the fetched page, and add any URLs he finds to the HashSet, before he then goes around the loop again. He is pretty satisfied -- the program seems to work well. However, it's fairly slow, as it only fetches one page at a time. Alan looks in the async book he discovered earlier, and sees a chapter titled "Doing many things at once". The chapter tells Alan that he has three options: use select to wait for the first of many futures to complete; use join to wait on many futures to all complete; and use spawn to run a future in the background. Alan figures that his program should keep many requests in flight at the same time, and then parse each one as it finishes, so he goes for the select approach. He writes: let mut requests = Select::new();
requests.insert(client.get(start_url).send());
while !requests.is_empty() { let response = requests.await; // Use quick-xml to extract urls from response. // For each url: if seen_urls.insert(url.clone()) { requests.insert(client.get(url).send()); }
} This works, and Alan is delighted. But it seems to work a bit too well -- his crawler is so fast that it starts getting rate-limited by the servers he runs it against. So, Alan decides to make his crawler a bit less aggressive, and adds a call to std::thread::sleep after he parses each page. He compiles his application again, and sees a new warning from the compiler: warning: blocking call in asynchronous code std::thread::sleep(Duration::from_secs(1)); ^^^^^^^^^^^^^^^^^^ help: If the thread is put to sleep, other asynchronous code running on the same thread does not get to run either.
suggestion: Use the asynchronous std::future::sleep method instead of std::thread::sleep in async code. reading: See the "Blocking in async code" chapter in the Rust async book for more details. Alan is happy that the compiler told him about this problem up front, rather than his downloads being held up during the entire sleep period! He does as the compiler instructs, and replaces thread::sleep with its asynchronous alternative and an await. He then runs his code again, and the warning is gone, and everything seems to work correctly. While looking at his code in his editor, however, Alan notices a little yellow squiggly line next to his while loop. Hovering over it, he sees a warning from a tool called "Clippy", that says: warning: while !requests.is_empty() { ^^^^^^^^^^^^^^^^^^^^^^^^^^ this loop let response = requests.await; ^^^^^^^^^^^^^^ awaits one future from a `Select` std::future::sleep(Duration::from_secs(1)).await; ^^^^^^^^^^^^^^^^^^ and then pauses, which prevents progress on the `Select` help: Futures do nothing when they're not being awaited, so while the task is asleep, the `Select` cannot make progress.
suggestion: Consider spawning the futures in the `Select` so they can run in the background. reading: See the "Doing many things at once" chapter in the Rust async book for more details. Alan first searches for "rust clippy" on his search engine of choice, and learns that it is a linter for Rust that checks for common mistakes and cases where code can be more idiomatic. He makes a mental note to always run Clippy from now on. Alan recognizes the recommended chapter title from before, and sure enough, when he looks back on the page that made him choose select, he sees a box explaining that, as the warning suggests, a Select only makes progress on the asynchronous tasks it contains when it is being awaited. The same box also suggests to spawn the tasks before placing them in the Select to have them continue to run even after the Select has yielded an item. So, Alan modifies his code to spawn each request: // For each url:
if seen_urls.insert(url.clone()) { requests.insert(std::future::spawn(async { client.get(url).send().await }));
} But now his code doesn't compile any more: error: borrow of `client` does not live long enough: let client = request::Client::new(); ^^^^^^ client is created here requests.insert(std::future::spawn(async { ^^^^^^^^^^^^^^^^^^ spawn requires F: 'static client.get(url).send().await ^^^^^^ this borrow of client makes the `async` block have lifetime 'a } ^ the lifetime 'a ends here when `client` is dropped. help: An async block that needs access to local variables cannot be spawned, since spawned tasks may run past the end of the current function.
suggestion: Consider using `async move` to move `client` if it isn't needed elsewhere, or keep `client` around forever by using `Arc` for reference-counting, and then `clone` it before passing it into each call to `spawn`. reading: See the "Spawning and 'static" chapter in the Rust async book for more details. Author note: the recommendation Arc above should be inferred from the Send bound on spawn. If such a bound isn't present, we should recommend Rc instead. Ideally we would also tailor the suggestion to whether changing async to async move would actually make the code compile. Alan is amazed at how comprehensive the compiler errors are, and is glad to see a reference to the async book, which he now realizes he should probably just make time to read start-to-finish, as it covers everything he's running into. Alan first tries to change async to async move as the compiler suggests, but the compiler then tells him that client may be used again in the next iteration of the loop, which makes Alan facepalm. Instead, he does as the compiler tells him, and puts the client in an Arc and clones that Arc for each spawn. At this point, the code looks a little messy, so Alan decides to open the referenced chapter in the async book as well. It suggests that while the pattern he's used is a good fallback, it's often possible to construct the future outside the spawn, and then await it inside the spawn. Alan gives that a try by removing the Arc again and writing: let fut = client.get(url).send();
requests.insert(std::future::spawn(async move { fut.await
})); Author note: how would the compiler tell Alan about this transformation rather than him having to discover it in the book? This works, and Alan is happy! Doubly-so when he notices the yellow Clippy squiggles telling him that the async move { fut.await } can be simplified to just fut. Alan runs his crawler again, and this time it doesn't run afoul of any rate limiting. However, Alan notices that it's still just parsing one page's HTML at a time, and wonders if he can parallelize that part too. He figures that since each spawned future runs in the background, he can just do the XML parsing in there too! So, he refactors the code for going from a URL to a list of URLs into its own async fn urls, and then writes: async fn urls(client: &Client, url: Url) -> Vec<Url> { /* .. */ } let mut requests = Select::new();
requests.insert(spawn(urls(&client, start_url)));
while !requests.is_empty() { let urls = requests.await; for url in urls { if seen_urls.insert(url.clone()) { requests.insert(spawn(urls(&client, url))); } } sleep(Duration::from_secs(1)).await;
} However, to Alan's surprise, this no longer compiles, and is back to the old 'static error: error: borrow of `client` does not live long enough: let client = request::Client::new(); ^^^^^^ client is created here requests.insert(spawn(urls(&client, start_url))); ^^^^^ spawn requires F: 'static requests.insert(spawn(urls(&client, start_url))); ^^^^^^^ but the provided argument is tied to the lifetime of this borrow } ^ which ends here when `client` is dropped. help: When you call an `async fn`, it does nothing until it is first awaited. For that reason, the `Future` that it returns borrows all of the `async fn`'s arguments.
suggestion: If possible, write the `async fn` (`urls`) as a regular `fn() -> impl Future` that first uses any arguments that aren't needed after the first `await`, and then returns an `async move {}` with the remainder of the function body. Otherwise, consider making the arguments reference-counted with `Arc` so that the async function's return value does not borrow anything from its caller. reading: See the "Spawning and 'static" chapter in the Rust async book for more details. With the compiler's helpful explanation, Alan realizes that this is another instance of the same problem he had earlier, and changes his async fn to: fn urls(client: &Client, url: Url) -> impl Future<Output = Vec<Url>> { let fut = client.get(url).send(); async move { let response = fut.await; // Use quick-xml to extract URLs to return. }
} At which point the code once again compiles, and runs faster than ever before! However, when Alan runs his crawler against a website with particularly large pages, he notices a new warning in his terminal when the crawler is running: ******************** [ Scheduling Delay Detected ] *********************
The asynchronous runtime has detected that asynchronous tasks are
occasionally prevented from running due to a long-running synchronous
operation holding up the executing thread. In particular, the task defined at src/lib.rs:88 can make progress, but
the executor thread that would run it hasn't executed a new asynchronous
task in a while. It was last seen executing at src/lib.rs:96. This warning suggests that your program is running a long-running or
blocking operation somewhere inside of an `async fn`, which prevents
that thread from making progress on concurrent asynchronous tasks. In
the worst instance, this can lead to deadlocks if the blocking code
blocks waiting on some asynchronous task that itself cannot make
progress until the thread continues running asynchronous tasks. You can find more details about this error in the "Blocking in async
code" chapter of the Rust async book. This warning is only displayed in debug mode.
************************************************************************ Looking at the indicated lines, Alan sees that line 88 is: requests.insert(spawn(urls(&client, url))); And line 96 is the loop around: match html_reader.read_event(&mut buf) { // ...
} Alan thinks he understands what the warning is trying to tell him, but he's not quite sure what he should do to fix it. So he goes to the indicated chapter in the async book, which says: If you have to run a long-running synchronous operation, or issue a blocking system call, you risk holding up the execution of asynchronous tasks that the current thread is responsible for managing until the long-running operation completes. You have many options for mitigating the impact of such synchronous code, each with its own set of trade-offs. It then suggests: Try to make the synchronous code asynchronous if possible. This could even just consist of inserting occasional voluntary scheduling points into long-running loops using std::future::yield().await to allow the thread to continue to make progress on asynchronous tasks. Run the synchronous code in a dedicated thread using spawn_blocking and simply await the resulting JoinHandle in the asynchronous code. Inform the runtime that the current thread (with block_in_place) that it should give away all of its background tasks to other runtime threads (if applicable), and only then execute the synchronous code. The document goes into more detail about the implications of each choice, but Alan likes the first option the best for this use-case, and augments his HTML reading loop to occasionally call std::future::yield().await. The runtime warning goes away.

902.body:
Alan now starts with his first async project. He opens up the Rust book to the "Async I/O" chapter and it guides him to writing his first program. He starts by writing some synchronous code to write to the file system: use std::fs::File; fn main() -> Result<(), Box<dyn std::error::Error>> { let mut file = File::create("a.txt")?; file.write_all(b"Hello, world!")?; Ok(())
} Next, he adapts that to run in an async fashion. He starts by converting main into async fn main: use std::fs::File; async fn main() -> Result<(), Box<dyn std::error::Error>> { let mut file = File::create("a.txt")?; file.write_all(b"Hello, world!")?; Ok(())
} The code compiles, but he gets a warning: warning: using a blocking API within an async function --> src/main.rs:4:25
1 | use std::fs::File; | ------------- try changing to `std::async_io::fs::File` | ...
4 | let mut file: u32 = File::create("a.txt")?; | ^^^^^^^^^^^^ blocking functions should not be used in async fn
help: try importing the async version of this type --> src/main.rs:1
1 | use std::async_fs::File; "Oh, right," he says, "I am supposed to use the async variants of the APIs." He applies the suggested fix in his IDE, and now his code looks like: use std::async_fs::File; async fn main() -> Result<(), Box<dyn std::error::Error>> { let mut file = File::create("a.txt")?; file.write_all(b"Hello, world!")?; Ok(())
} His IDE recompiles instantaneously and he now sees two little squiggles, one under each ?. Clicking on the errors, he sees: error: missing await --> src/main.rs:4:25
4 | let mut file: u32 = File::create("a.txt")?; | ^ returns a future, which requires an await
help: try adding an await --> src/main.rs:1
4 | let mut file: u32 = File::create("a.txt").await?; He again applies the suggested fix, and his code now shows: use std::async_fs::File; async fn main() -> Result<(), Box<dyn std::error::Error>> { let mut file = File::create("a.txt").await?; file.write_all(b"Hello, world!").await?; Ok(())
} Happily, it compiles, and when he runs it, everything works as expected. "Cool," he thinks, "this async stuff is pretty easy!"

